		<style>
		*, *:before, *:after {
		-moz-box-sizing: border-box;
		-webkit-box-sizing: border-box;
		box-sizing: border-box;
		}

		body {
		font-family: 'Nunito', sans-serif;
		color: #384047;
		}

		section {
		max-width: 450px;
		margin: 10px auto;
		padding: 10px 20px;
		background: #f4f7f8;
		border-radius: 8px;
		}
=
		h1 {
		margin: 0 0 30px 0;
		text-align: center;
		}

		input[type="text"],
		input[type="password"],
		input[type="date"],
		input[type="datetime"],
		input[type="email"],
		input[type="number"],
		input[type="search"],
		input[type="tel"],
		input[type="time"],
		input[type="url"],
		textarea,
		select {
		background: rgba(255,255,255,0.1);
		border: none;
		font-size: 16px;
		height: auto;
		margin: 0;
		outline: 0;
		padding: 15px;
		width: 100%;
		background-color: #e8eeef;
		color: #8a97a0;
		box-shadow: 0 1px 0 rgba(0,0,0,0.03) inset;
		
		}

		input[type="radio"],
		input[type="checkbox"] {
		margin: 0 4px 8px 0;
		display: inline-block;
		}

		select {
		padding: 6px;
		height: 32px;
		border-radius: 2px;
		}

		button {
		padding: 19px 39px 18px 39px;
		color: #FFF;
		background-color: #4bc970;
		font-size: 18px;
		text-align: center;
		font-style: normal;
		border-radius: 5px;
		width: 100%;
		border: 1px solid #3ac162;
		border-width: 1px 1px 3px;
		box-shadow: 0 -1px 0 rgba(255,255,255,0.1) inset;
		margin-bottom: 10px;
		}

		fieldset {
		margin-bottom: 30px;
		border: none;
		}

		legend {
		font-size: 1.4em;
		margin-bottom: 10px;
		}

		label {
		display: block;
		margin-bottom: 8px;
		}

		label.light {
		font-weight: 300;
		display: inline;
		}	

		.number {
		background-color: #5fcf80;
		color: #fff;
		height: 30px;
		width: 30px;
		display: inline-block;
		font-size: 0.8em;
		margin-right: 4px;
		line-height: 30px;
		text-align: center;
		text-shadow: 0 1px 0 rgba(255,255,255,0.2);
		border-radius: 100%;
		}

		@media screen and (min-width: 480px) {

		form {
		max-width: 480px;
		}

		}
		th, td,tr{
		  border: 1px solid black;
		  text-align:center;
		}
		/* Estilos para el fondo oscuro */
		.overlay {
		  position: fixed;
		  top: 0;
		  left: 0;
		  width: 100%;
		  height: 100%;
		  background-color: rgba(0, 0, 0, 0.5);
		  display: flex;
		  justify-content: center;
		  align-items: center;
		  z-index: 9999;
		}
		.overlay1 {
		  position: fixed;
		  top: 0;
		  left: 0;
		  width: 100%;
		  height: 100%;
		  background-color: rgba(0, 0, 0, 0.5);
		  display: flex;
		  justify-content: center;
		  align-items: center;
		  z-index: 9999;
		}

		/* Estilos para el contenedor del pop-up */
		.popup {
		  background-color: white;
		  border-radius: 8px;
		  padding: 20px;
		  max-width: 800px;
		  text-align: center;
		  position: absolute;
		  top: 50%;
		  left: 50%;
		  transform: translate(-50%, -50%);
		}
		.popup1 {
		  background-color: white;
		  border-radius: 8px;
		  padding: 20px;
		  max-width: 800px;
		  text-align: center;
		  position: absolute;
		  top: 50%;
		  left: 50%;
		  transform: translate(-50%, -50%);
		}

		/* Estilos para el lienzo (canvas) */
		#signatureCanvas {
		  border: 1px solid black;
		}
		#signatureCanvas1 {
		  border: 1px solid black;
		}
		.button-container {
		  text-align: center;
		}

		.button-container button {
		  display: inline-block;
		  margin: 5px;
		}

		</style>
    </head>
    <body>
      <div class="row">
    <section id="formulario" class="col-md-12">

	function mostrarFechaHoraActual() {
	  var fechaHoraActual = new Date();
	  
	  // Obtener los componentes de la fecha y hora
	  var dia = fechaHoraActual.getDate();
	  var mes = fechaHoraActual.getMonth() + 1; // Los meses comienzan en 0
	  var anio = fechaHoraActual.getFullYear();
	  var hora = fechaHoraActual.getHours();
	  var minutos = fechaHoraActual.getMinutes();
	  var segundos = fechaHoraActual.getSeconds();
	  
	  // Formatear los componentes
	  if (dia < 10) dia = "0" + dia;
	  if (mes < 10) mes = "0" + mes;
	  if (hora < 10) hora = "0" + hora;
	  if (minutos < 10) minutos = "0" + minutos;
	  if (segundos < 10) segundos = "0" + segundos;
	  
	  // Construir la cadena de fecha y hora
	  var fechaHoraActualFormateada = anio + "-" + mes + "-" + dia + " " + hora + ":" + minutos + ":" + segundos;
	  
	  // Actualizar el contenido del elemento HTML
	  <!-- document.getElementById("fecha_ent").textContent = fechaHoraActualFormateada; -->
	  fecha_ent.value = fechaHoraActualFormateada;
	  <!-- console.log(fechaHoraActualFormateada); -->
	  
	  // Actualizar cada segundo
	  setTimeout(mostrarFechaHoraActual, 1000);
	};

	function mostrarOpciones(selector, opcionesLista) {
		var opcionSeleccionada = selector.value;

		var lista = opcionesLista[opcionSeleccionada];

		// Obtener el elemento datalist y limpiarlo
		var datalist = document.getElementById("opciones-lista");
		datalist.innerHTML = "";

		// Agregar las opciones al datalist
		for (var i = 0; i < lista.length; i++) {
			var opcion = lista[i];
			var optionElement = document.createElement("option");
			optionElement.value = opcion;
			datalist.appendChild(optionElement);
		}
	}

	function filtrarOpciones(inputId) {
		var busquedaInput = document.getElementById(inputId);
		var opcionesDatalist = document.getElementById("opciones-lista");

		var busqueda = busquedaInput.value.toLowerCase();

		// Mostrar solo las opciones que coincidan con la búsqueda
		for (var i = 0; i < opcionesDatalist.options.length; i++) {
			var option = opcionesDatalist.options[i];
			var opcionTexto = option.value.toLowerCase();

			if (opcionTexto.indexOf(busqueda) === -1) {
				option.style.display = "none";
			} else {
				option.style.display = "block";
			}
		}
	}

	function transformarEstructura(estructuraOriginal) {
	  const nuevaEstructura = [];

	  for (let i = 0; i < estructuraOriginal.length; i += 3) {
		const primerArray = estructuraOriginal[i];
		const segundoArray = estructuraOriginal[i + 1];
		const tercerArray = estructuraOriginal[i + 2] || [];
		console.log(primerArray,i);
		nuevaEstructura.push([...primerArray, ...segundoArray, ...tercerArray]);
	  }

	  return nuevaEstructura;
	}
	function dividirYCrearSubarrays(cadena) {
		const elementos = cadena.split(',');
		const subarrays = [];

		for (let i = 0; i < elementos.length; i += 3) {
		subarrays.push(elementos.slice(i, i + 3));
		}

		return subarrays;
	}
	function agruparEnSubarrays(array, elementosPorSubarray,arrayEntRec) {
		const subarrays = [];
		for (let i = 0; i < array.length; i += elementosPorSubarray) {
		const subarray = array.slice(i, i + elementosPorSubarray);
		subarrays.push([...arrayEntRec,...subarray]);
		}
		return subarrays;
	}

	function obtenerFechaYHoraActual() {
		const fecha = new Date();

		const year = fecha.getFullYear();
		const month = String(fecha.getMonth() + 1).padStart(2, '0');
		const day = String(fecha.getDate()).padStart(2, '0');
		const hours = String(fecha.getHours()).padStart(2, '0');
		const minutes = String(fecha.getMinutes()).padStart(2, '0');
		const seconds = String(fecha.getSeconds()).padStart(2, '0');

		return `${year}${month}${day}_${hours}${minutes}${seconds}`;
	}
	function loadAndResizeImage(event) {
		var imageInput = document.getElementById('image-input');	
		var imageContainer = document.getElementById('image-container');
		var image = document.createElement('img');
		//var botonElegir = document.getElementById("image-input");
		//botonElegir.style.display = "none;";
		image.onload = function() {
			var maxWidth = 330; // Ancho máximo ','
			var maxHeight = 100; // Alto máximo permitido

			// Calcular las dimensiones ajustadas de la imagen
			var width = this.width;
			var height = this.height;
			if (width > maxWidth || height > maxHeight) {
				var ratio = Math.min(maxWidth / width, maxHeight / height);
				width = Math.round(width * ratio);
				height = Math.round(height * ratio);
			}

			// Aplicar las dimensiones ajustadas a la imagen
			this.style.width = width + 'px';
			this.style.height = height + 'px';
			var canvas = document.createElement("canvas");
			canvas.width = this.width;
			canvas.height = this.height;
		
			var ctx = canvas.getContext("2d");
			ctx.drawImage(image, 0, 0);    
			var dataURL = canvas.toDataURL("image/png");
			//console.log(dataURL);
			firma_entrega = dataURL;
		};	
		image.src = URL.createObjectURL(imageInput.files[0]);
		document.getElementById("cargarFirma").style.display = "none";
		document.getElementById("image-input").style.display = "none";
		imageContainer.innerHTML = '';
		imageContainer.appendChild(image);
		closePopup();
	}
